import React from "react";
import "./style.css";
import {
  //   useGetData,
  usePostData,
  //   useEditData,
  //   useDeleteData,
} from "../../../axios/hooks";
import { Button, Modal } from "antd";
import { useState } from "react";
import "antd/dist/reset.css";
import { useForm } from "react-hook-form";

export default function PostProduct() {
  const post = usePostData("/products");
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();
  const onSubmit = (data) => postData(data);
  // console.log(errors);

  const postData = (data) => {
    console.log(data);
    // post.mutate(data, {
    //   onSuccess: (post) => console.log(post, "data"),
    //   onError: (error) => console.log(error, "error"),
    // });
  };

  //   if (isLoading) {
  //     return <p>isLoading</p>;
  //   }
  //   if (isError) {
  //     return <p>error check your internet</p>;
  //   }
  const [open, setOpen] = useState(false);
  return (
    <div>
      <>
        <Button type="primary" onClick={() => setOpen(true)}>
          Create post
        </Button>
        <Modal
          title="Create post"
          centered
          open={open}
          onOk={() => setOpen(false)}
          onCancel={() => setOpen(false)}
          width={1000}
        >
          <>
            <form onSubmit={handleSubmit(onSubmit)}>
              <input type="text" placeholder="Type" {...register("Type", {})} />
              <input
                type="checkbox"
                placeholder="Active"
                {...register("Active", {})}
              />
              <input
                type="number"
                placeholder="Size"
                {...register("Size", {})}
              />

              <div className="form-flex">
                <h4>Both</h4>
                <input
                  {...register("Gender")}
                  type="radio"
                  value="Both"
                  placeholder="gender"
                />
                <h4>Male</h4>
                <input
                  {...register("Gender")}
                  type="radio"
                  value=" Men"
                  placeholder="gender"
                />
                <h4>Famale</h4>
                <input
                  {...register("Gender")}
                  type="radio"
                  value=" Woman"
                  placeholder="gender"
                />
              </div>
              <input
                type="text"
                placeholder="Color"
                {...register("Color", {})}
              />
              <input
                type="text"
                placeholder="Name_UZ"
                {...register("Name_UZ", {})}
              />
              <input
                type="text"
                placeholder="Name_RU"
                {...register("Name_RU", {})}
              />
              <input
                type="text"
                placeholder="Name_EN"
                {...register("Name_EN", {})}
              />
              <input
                type="number"
                placeholder="Price"
                {...register("Price", {})}
              />
              <input
                type="number"
                placeholder="Discount"
                {...register("Discount", {})}
              />
              <input
                type="text"
                placeholder="Description_Uz"
                {...register("Description_Uz", {})}
              />
              <input
                type="text"
                placeholder="description_RU"
                {...register("description_RU", {})}
              />
              <input
                type="text"
                placeholder="description_EN"
                {...register("description_EN", {})}
              />
              <input
                type="number"
                placeholder="Category_ID"
                {...register("Category_ID", {})}
              />
              <input
                type="number"
                placeholder="Photo_id"
                {...register("Photo_id", {})}
              />

              <input type="submit" />
            </form>
          </>
        </Modal>
      </>
    </div>
  );
}
